import React, { Component } from "react";
import "./css/start.css";
import DoorUI from "./js/button";
import axios from 'axios';

const postId = 'YOUR_POST_ID_HERE'; // Replace with one of your posts id.

// Request API.
axios
  .get('http://localhost:1337/posts', {
    params: {
      _sort: 'createdAt:desc' // Generates http://localhost:1337/posts?_sort=createdAt:desc
    }
  })
  .then(response => {
    // Handle success.
    console.log('Well done, here is the list of posts: ', response.data);
  })
  .catch(error => {
    // Handle error.
    console.log('An error occurred:', error);
  });
class Start extends Component {
  render() {
    return (
      <div className="section_center">
        <div className="backgraund" />
        <div className="container">
          <p>
            <span>ComputerBOX </span>-&nbsp;это сервис,<br /> позволяющий быстро
            собрать компьютер
            <br />
            по своим критериям.
          </p>
          <div className="d-flex button_size">
            <p className="">Начинай собирать его прямо сейчас</p>
            <p>Нажимай</p>
          </div>
          <DoorUI></DoorUI>
        </div>
      </div>
    );
  }
}
export default Start;
